import React from 'react';
import {connect} from "react-redux";

const App = (props) => {
    const {formValues,names} = props
    console.log(names)
    return (
        <div>
            {names.map((name) => (
                <p>{name}</p>
            ))}

        </div>
    );
};

const mapStateToProps = (state) => {
    return {
        formValues: state.formValues,
        names: state.name
    }
}

export default connect(mapStateToProps,{})(App);
